import React, { useEffect, useState }  from "react";

import styles from './Payment.module.css';

const Payment = (props) =>{

    useEffect(() => {
        let ac = document.getElementById('manage-payments');
        console.log(ac.classList);
        onAddClass(ac);
    },[])

    const onAddClass = (ac) => {
        document.getElementById('manage-inventory').classList.remove(`${styles.active}`)
        document.getElementById('manage-products').classList.remove(`${styles.active}`)
        document.getElementById('manage-products').classList.remove(`${styles.active}`)
        ac.classList.add(`${styles.active}`);
    }

    return( 
            <React.Fragment>
                {/* <div className={`${styles.main}`}>
                    New Product
                </div>  */}
                    <div className={`${styles.container}`}> 
                        Payment
                    </div>
            </React.Fragment>
            )
}

export default Payment;
